import {BUSCAR_CONDUCTOR, OBTENER_DETALLES_CONDUCTOR } from "./action-types.js"


export const seleccionarConductor = (id) => ({
    type: SELECCIONAR_CONDUCTOR,
    payload: id
  });
  
  export const obtenerDetallesConductor = (id) => ({
    type: OBTENER_DETALLES_CONDUCTOR,
    payload: id
  });
